import string

INPUT = ''


def reduce_units(units):
    i = 0
    while i < (len(units) - 1):
        unit_1 = units[i]
        unit_2 = units[i + 1]
        if unit_1.lower() == unit_2.lower() and unit_1 != unit_2:
            units = units[:i] + units[i + 2:]
            i -= 1
        else:
            i += 1
    return units

def most_reduced_polymer(units):
    lowercase_letters = string.ascii_lowercase
    most_reduced = len(units)
    for letter in lowercase_letters:
        replaced_units = units.replace(letter, '')
        replaced_units = replaced_units.replace(letter.upper(), '')
        reduced_units = reduce_units(replaced_units)
        if len(reduced_units) < most_reduced:
            most_reduced = len(reduced_units)

    return most_reduced

if __name__ == '__main__':
    print(most_reduced_polymer(INPUT))
